import React,{Component} from 'react';
import TopEvents from "../Events/TopEvents";

class Footer extends Component{
  render(){
    return(
      <div>
        <TopEvents />
        <h3>Tugas 3 ReactJS</h3>
      </div>
    );
  }
}

export default Footer;
